import DefaultLayout from '../components/layouts/DefaultLayout';
import SlugPage from './[page]';

/* This route gets hit by default, e.g. your-site.com */
const DefaultPage = () => {
  return (
    <DefaultLayout>
      <h1>Default Page</h1>
      <a href="/welcome">->Visit a Slug Page</a>
      <SlugPage />
    </DefaultLayout>
  );
};

export default DefaultPage;
